import { Table, TableBody, TableCell, makeStyles,TableContainer, TableHead, TableRow, ThemeProvider } from '@material-ui/core';
import axios from 'axios';
import React, { useEffect, useState } from 'react';
import VisibilityOutlinedIcon from '@material-ui/icons/VisibilityOutlined';
import CircularProgress from '@material-ui/core/CircularProgress';
const useStyles = makeStyles((theme) => ({
    fechingicon:{
       position:'absolute',
       top:'40%',
       left:'45%'
    }
  }));
const DataTable = () => { 
    const classes=useStyles()
    const {api} =window['runtime-config']
    let [questions,setQuestions]=useState([]);
    let [isDataFecteched , setisDataFeteched]=useState(false)
 useEffect(()=>{

    fetchingData()

 },[])
  const fetchingData = async()=>{
    try {
        setisDataFeteched(true)
        const record=await axios.get(api);
        setQuestions(record.data)
        setisDataFeteched(false)
    }
    catch(error)
    {
        console.log(error);
    }
  }

    return isDataFecteched?<CircularProgress className={classes.fechingicon}/> :  ( 
      <TableContainer>
          <Table >
              <TableHead style={{backgroundColor:ThemeProvider.palette.common.black}}>
                  <TableRow >
                      <TableCell>ID</TableCell>
                      <TableCell>ENGLISH</TableCell>
                      <TableCell>TYPE</TableCell>
                      <TableCell>LEVEL</TableCell>
                      <TableCell>ACTION</TableCell>
                  </TableRow>
              </TableHead>
              <TableBody hover="true">

                   {questions.map(q=>
                   <TableRow hover="true">
                     <TableCell>{q.id}</TableCell>
                     <TableCell>{q.statement_en}</TableCell>
                     <TableCell>{q.type}</TableCell>
                     <TableCell>{q.level}</TableCell>
                     <TableCell><VisibilityOutlinedIcon/></TableCell>
                     </TableRow>
                    )}


              </TableBody>
          </Table>
      </TableContainer>
     );
}

export default DataTable;
